import React from 'react';
// import "./NavBar.css";
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, NavItem } from 'reactstrap';
import logo from './images/MusicMatchLogoWhiteSmall.png';


function NavBar() {

  return (
    <div className="justify-content-center">
      <div>
        <a className="justify-content-center"><img src={logo} className="justify-content-center" alt=""></img></a>
      </div>
    </div>
  );
}

export default NavBar;
